import React from "react";
import EventItem from "./EventItem";
import OrgSidebar from "./OrgSidebar";

function CreateEvents() {
  return (
    <>
      <OrgSidebar/>
      <div
        style={{
          paddingTop: "100px",
          paddingLeft: "30%",
          height: "100%",
        }}
      >
        <EventItem />
        <EventItem />
        <EventItem />
        <EventItem />
      </div>
    </>
  );
}

export default CreateEvents;
